import React from 'react';
import "./SideBar.css";

function SideBar() {
    return (
        <div className="SidBar">
            <ul>
                <li 
                onClick={() => "/Garage"}
                >
                    Garage</li>
            </ul>
        </div>
    )
}

export default SideBar
